import {
  Box,
  Button,
  Grid,
  Paper,
  TextField,
  Typography,
} from "@material-ui/core";
import { Formik, Field, Form, ErrorMessage } from "formik";
import { useState } from "react";
import * as yup from "yup";

const NewForm = ({ addNewFood }) => {
  const initialValue = {
    name: "",
    inventory: "",
  };

  const foodValidation = yup.object().shape({
    name: yup.string("Enter a valid name").required("Name is required"),
    inventory: yup.number("Enter an inventory amount"),
  });

  async function handleSubmit(values, props) {
    console.log(values);
    alert(JSON.stringify(values));

    let food = await addNewFood({
      name: values.name,
      inventory: parseInt(values.inventory),
    });

    console.log(food);
    if (food) {
      history.push("/food");
      props.resetForm();
    }
  }

  return (
    <Grid container>
      <Grid item sm={3} xs={false}></Grid>
      <Grid item sm={6} xs={12}>
        <Paper>
          <Box m={5} p={3}>
            <Typography variant="h5">Basic Formik Form Validation</Typography>
            <Formik
              initialValues={initialValue}
              validationSchema={foodValidation}
              onSubmit={handleSubmit}
            >
              {(props) => {
                const { name, inventory } = props.values;
                return (
                  <Form>
                    <TextField
                      label="Name"
                      name="name"
                      fullWidth
                      variant="outlined"
                      margin="dense"
                      value={name}
                      onChange={props.handleChange}
                      onBlur={props.handleBlur}
                      helperText={<ErrorMessage name="name" />}
                      error={props.errors.name && props.touched.name}
                      required
                    />

                    <TextField
                      label="Inventory"
                      name="inventory"
                      fullWidth
                      variant="outlined"
                      margin="dense"
                      value={inventory}
                      onChange={props.handleChange}
                      onBlur={props.handleBlur}
                      helperText={<ErrorMessage name="inventory" />}
                      error={props.errors.inventory && props.touched.inventory}
                      required
                    />

                    <Button
                      variant="contained"
                      type="submit"
                      color="primary"
                      fullWidth
                    >
                      Submit
                    </Button>
                  </Form>
                );
              }}
            </Formik>
          </Box>
        </Paper>
      </Grid>
      <Grid item sm={3} xs={false}></Grid>
    </Grid>
  );
};

export default NewForm;
